#!/usr/bin/env python
# -*- coding: utf-8 -*-

class Solution:
    dp = []
    sa = None
    sb = None
    def dfs(self, ia, ib):
        if self.dp[ia][ib] is not None:
            return self.dp[ia][ib]
        if ib == len(self.sb):
            self.dp[ia][ib] = 1
            return self.dp[ia][ib]
        if ia == len(self.sa):
            self.dp[ia][ib] = 0
            return self.dp[ia][ib]
        res = 0
        if self.sa[ia] == self.sb[ib]:
            res = res + self.dfs(ia+1, ib+1)
        res = res + self.dfs(ia+1, ib)
        self.dp[ia][ib] = res
        return self.dp[ia][ib]


    def numDistinct(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: int
        """
        import sys
        sys.setrecursionlimit(100000)
        ns = []
        for c in s:
            if c not in t:
                continue
            ns.append(c)
        s = "".join(ns)
        n1 = len(s) + 1
        n2 = len(t) + 1
        self.sa = s
        self.sb = t
        self.dp = [[None for x in range(n2)] for y in range(n1)]
        return self.dfs(0, 0)

solution = Solution()
print(solution.numDistinct('rabbbit', 'rabit'))
print(solution.numDistinct("", "rwmimatmhydhbujebqehjprarwfkoebcxxqfktayaaeheys"))
